State files an Amended Information charging 2 ct. Possess Controlled Substance, contrary to Section 961.41(3g)(d).   
Guilty pleas to the amended charges.   Convicted.   Sentences are withheld.   Defendant is placed on probation to DOC for eighteen (18) months.   Conditions of probation are:  
1) On Count 1 only, impose and stayed thirty (30) days jail;
2) On Count 1 only, perform fifty (50) hours of community service work within the first 6 months;
3) AODA assessment and follow through;
4) Submit to random urine screens and pay for same;
5) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
6) Maintain full-time employment/work search combination;
7) Pay costs of action; 
8) Pay supervision fees in an amount to be determined by DOC.
Court finds defendant will benefit and society will not be harmed by expungment of record pursuant to Section 973.015 of the Wisconsin Statutes upon successful completion of sentence.   
Plea Questionnaire/Waiver of Rights. 
Notice of Right to Seek Postconviction Relief.   
